SELECT * FROM logs;

-- 2. (по желанию) Создайте SQL-запрос, который помещает в таблицу users миллион записей.

DROP PROCEDURE IF EXISTS many_users;
DELIMITER $$
CREATE PROCEDURE many_users(number_of_iterations INT)
BEGIN
    SET @x = 1;
    REPEAT 
        SET @x = @x + 1; 
    UNTIL @x > number_of_iterations END REPEAT;
END$$
DELIMITER ;

-- выполняется долго
CALL many_users(100);

SELECT count(*) FROM users;

